import React from 'react'

function Timetable(props) {
    let subjects = Object.entries(props.subjects);
    let subjectsToRender = []

    for(let i = 0; i < subjects.length; i++) {
      subjectsToRender.push(
      <div className="d-flex flex-row schedule-block">
        <div className="num-col">
          {i}
        </div>
        <div className="subject-grey">
          <p className="subject-name">{subjects[i][1]}</p>
          <p className="room-name">–ê204</p>
        </div>
      </div>
      )
    }

    return (
        <div className = "col-lg-3 col-md-4 col-sm-6">
            <div className="timetable">
                <h6>{props.partyName}</h6>
                {subjectsToRender}
            </div>
        </div>
    )
}

export default Timetable
